window.bookSummaryJSON = "<p><b>After regaining her memories from her past life, Jasora embarks on a journey to uncover the dark secrets hidden within the Maikoh Tribe, the community of her mate, Wolfgang.</b></p> <p>As she delves deeper into the tribe's secrets, she finds herself in danger, her life threatened by those who wish to keep the truth buried.</p> <p>Jasora's determination to expose the people in Wolfgang's tribe puts her in a precarious position. Will she be able to maintain her role as the alpha's mate, or will she face banishment from the community? As she grapples with the challenges of being a Lycan's wife, another alpha named Rakeem enters the picture, driven by the desire to reclaim his lost love.</p> <p>Jasora: An Alpha's Queen 2 <i>continues the story from where part one left off. This urban paranormal tale revolves around the intertwining destinies of Jasora and Wolfgang as they defy all odds. The long-standing battle between two ancient tribes over a woman of exceptional beauty will eventually reach its conclusion. The story explores themes of love, destiny, and the lengths to which individuals will go to protect what they hold dear.</i></p>"; 
